import React from 'react';
import SquareButton from './SquareButton'
import './App.css';
import Selector from "./selector"


function App() {

  let position = 500

  return(
    <div id = "content">
    <div id = "buttonBlock">
    <SquareButton color="goldenrod"></SquareButton>
    <SquareButton color="red"></SquareButton>
    <SquareButton color= "slategrey"></SquareButton>
    <SquareButton color = "darkcyan"></SquareButton>
  </div>
  <div id = "selectorblock">
   < Selector position = {position}>  </Selector>
  </div>
  </div>
  );
}

export default App;
